import React from 'react';
import {
    Container,
    Card,
    Grid,
    Paper,
    Typography,
    Button,
    TextField,
    AppBar,
    Avatar,
    Toolbar,
} from "@mui/material";
import { styled } from '@mui/system';
import PersonIcon from '@mui/icons-material/Person';

function Login() {
    return (
        <Container sx={{ mt: 10 }}>
            <LoginPaper elevation={2}>
                <GridBox m={2} container spacing={2}>
                    {/* 엘리베이션 박스뒤에 음영강도 */}
                    <Grid item>
                        <PersonIcon />
                    </Grid>
                    <Grid>
                        <Typography>Log in</Typography>
                    </Grid>
                    <Grid>
                        <TextField rows={1} label="아이디" placeholder="your id" />
                    </Grid>
                    <Grid>
                        <TextField label="비밀번호" placeholder="your password" />
                    </Grid>
                </GridBox>
            </LoginPaper>


        </Container >
    )
}

export default Login;


const GridBox = styled(Grid)({
    width: "100%",
    display: "flex",
    justifyContent: "center",
    flexDirection: "column",
    border: "1px solid salmon"
})

const LoginPaper = styled(Paper)({
    width: 260,
    height: 320,
    display: "flex",
    justifyContent: "center",

})
